VALUES ('5900343003148', 'Vodka Zubrowka 70cL', 'ZUBROWKA 700mle région lointaine de la Pologne située dans les basses terres aunord de la Podlasie se trouve un lieu mystérieux désigné sous le de Bialowieia, ultime forêt vierge en Europe qui abrite les derniers troupeaux de bisons de même qu\'une plante aromatique et )articulière, l\'herbe de bison. Nommée en l\'honneur du bison, cette plante aromatique a résisté à la culture, et jusqu\'à ce jour, demeure cueillie à la main. Depuis des siècles, l\'herbe de bison a été utilisée [t) vodka remarquable, Zubrowka (prononcer \'ZOO-BR Elle lui confère une douceur et une fraicheur inégalée. allongée de jus de pomme. Elle réhausse à merveille vos coc àbasedevodka. fabriquée par CEDC International sp. z o.o., dans sa distillçrie Biakystok, la seule en Pologne autorisée à produire Zubr h\\odka à l\'herbe de bison.', 'https://static.openfoodfacts.org/images/products/590/034/300/3148/front_fr.11.400.jpg', '1', '1', '1', '1', '', '100', '0', '0', '40', '0');

