VALUES ('5900344001761', 'Sałatka z pieczonym mięsem z kurczaka, kukurydzą i białą kapustą', 'Olej rzepakowy, 20% gyros z kurczaka (mięso z uda kurczaka bez skóry, skrobia kukurydziana, sól, stabilizatory: trifosforany, difosforany, polifosforany, cytryniany sodu, octany sodu; przeciwutleniacze: kwas askorbinowy, askorbinian sodu; substancja zagęszczająca: karagen), 13% ziemniaki gotowane, 9% biała kapusta sałatkowa, 7% cebula marynowana, woda, 5% ogórki konserwowe, 5% kukurydza konserwowa, 5% czerwona papryka konserwowa, cukier, koncentrat pomidorowy, przyprawy, koncentrat soku z cytryny, sól, mielona _gorczyca_, ocet spirytusowy, przyprawa shoarma [sól, papryka, kolendra, kumin, chili, kurkuma, cebula, cynamon, _gorczyca_, czosnek, przyprawy, ekstrakt przypraw (papryka, imbir)], żółtko _jaja_, regulatory kwasowości (kwas mlekowy, kwas cytrynowy), substancja zagęszczająca (guma ksantanowa), substancje konserwujące (sorbinian potasu, benzoesan sodu). Produkt może zawierać: ryby, skorupiaki, gluten, mleko, soję, sezam i seler.', 'https://static.openfoodfacts.org/images/products/590/034/400/1761/front_pl.16.400.jpg', '23', '2.2', '9.3', '5.8', '', '4.5', '1.4', '0.551181102362205', '', '0');

