VALUES ('5900397734838', 'Fasolka po bretońsku z boczkiem i kiełbasą', 'Fasola gotowana 35%, woda, boczek (5,2%) [boczek wieprzowy (81%), woda, substancja zagęszczająca: alginian sodu, cukier, hydrolizat białka roślinnego (kukurydziany), aromat dymu wędzarniczego, sól, ocet w proszku], kiełbasa (5,2%) [mięso wieprzowe (47%), mięso wołowe (31%), woda, tłuszcz wieprzowy, błonnik _sojowy_, skrobia ziemniaczana, kasza manna (_gluten_), sól, białko kolagenowe wieprzowe, przyprawy], koncentrat pomidorowy (4,5%), przecier z cebuli (3%), mąka _pszenna_, skrobia modyfikowana kukurydziana, cukier, sól, przyprawy (zawierają _soję_) i ekstrakty przypraw, glukoza, suszone warzywa (marchew, cebula, korzeń _selera_, czosnek, korzeń lubczyka, pietruszka), zioła (w tym _mageranek_), suszone koncentraty i ekstrakty warzywne (w tym _selera_), ekstrakt drożdżowy, regulator kwasowości - kwas cytrynowy, hydrolizat białka roślinnego (kukurydziany) aromaty.', 'https://static.openfoodfacts.org/images/products/590/039/773/4838/front_pl.4.400.jpg', '2.5', '0.9', '9.4', '2.9', '', '4.5', '1', '0.393700787401575', '', '1');

