VALUES ('5900397734944', 'Gołąbki w sosie pomidorowym', 'Składniki: woda, kapusta biała (26%), farsz (24%) - [ryż biały gotowany (38%), mięso wieprzowe (25%), mięso drobiowe (14%), woda, białko pszenicy, mąka pszenna, sól, białko sojowe, stabilizatory: E450, E451, E452, przyprawy, wzmacniacze smaku: E621, E635, warzywa suszone w zmiennych proporcjach ( marchew, cebula, pasternak, czosnek, liście selera, natka pietruszki, papryka, pomidory), cukier, hydrolizat białka sojowego, ekstrakt drożdżowy, aromaty ( zawierają: soję, gluten) ],  koncentrat pomidorowy (2,4%), marchew (2.3%) pietruszka, cebula (1,3%), substancja zagęszczająca - E1422, seler, cukier, sól, emulgator - E471, stabilizatory: E331, E340, mąka pszenna, przyprawy, podgrzybek suszony, aromaty, preparaty aromatyczne, środki aromatyczne z przetwarzania termicznego, wzmacniacze smaku: E621, E635, warzywa suszone w zmiennych proporcjach ( marchew, cebula, pasternak, czosnek, liście selera, natka pietruszki, papryka, pomidory), olej rzepakowy, hydrolizat białka sojowego, ekstrakt drożdżowy, białka mleka, syrop glukozowy ( może pochodzić z pszenicy), tłuszcz kokosowy całkowicie utwardzony, glukoza. Może zawierać: gorczycę, jaja, sezam.', 'https://static.openfoodfacts.org/images/products/590/039/773/4944/front_pl.4.400.jpg', '2.6', '0.8', '8.3', '1.3', '', '3', '0.6', '0.236220472440945', '0', '1');

