INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5900397735057', 'Kociołek Boloński', 'Kociołek Boloński. Produkt garmażeryjny. Sterylizowany. Składniki: woda, mięso wieprzowe mielone 12%), makaron (6,5%) [maka z pszenicy durum] koncentrat pomidorowy (6%), cebula (5%), skrobia modyfikowana kukurydziana, pomidory (3%), marchew (2%), papryka czerwona, błonnik pszenny, białko wieprzowe, stabilizator - trifosforany, maltodekstryna, cukier, sól, olej rzepakowy, przyprawy i ekstrakty przypraw, zioła (w tym bazylia), aromaty (zawierają soję), warzywa i ekstrakty warzyw, regulator kwasowości - kwas cytrynowy. All-in One Bolognese Dish. Ready-made prouct Sterillized. Ingredients: water, pork minced meat (12%), pasta (6.5%), [durum wheat flour], tomato concentrate (6%), onion (5%), modified corn starch, tomatoes 3% carrot (2%), red pepper, wheat fiber, protein pork, stabilizer - triphosphate, maltodextrin, sugar, salt, canola oil, spices and spice extracts, herbs (contain basil), flavours (contain soya), vegetables and vegetable extracts, acidity regulator - citric acid.', 'https://static.openfoodfacts.org/images/products/590/039/773/5057/front_pl.4.400.jpg', '1.8', '0.8', '9.9', '3.1', '', '3', '1.1', '0.433070866141732', '0', '0');

