VALUES ('5900500038594', 'Hortex BRASIL', 'woda, soki owocowe z soków zagęszczonych i przecierów Z: jabłek (7%), bananów (6%), limonek (4%), opuncji (1%), grawioli (1%), kaki (1%); cukier, regulatory kwasowości-kwas cytrynowy, cytryniany sodu; aromaty, przeciwutleniacz - kwas askorbinowy, maltodekstryna, substancja zagęszczająca - karboksymetyloceluloza, barwniki - kompleksy miedziowe chlorofili i chlorofilin, karoteny, antocyjany Przed otwarciem wstrząsnąć. Chronić przed światem. Ewentualny osa lub rozwarstwienie produktu nie stanowi wady, jest naturalne i wynika z zawartości przecieru owocowego. Najlepiej spożyć przed końcem: data podana poniżej nakrętki. Przechowywać w suchym i chłodnym miejscu. Po otwarciu przechowywać w lodówce i spożyć w ciągu 2 dni. Niewłaściwe przechowywanie produktu, szczególnie po otwarciu może spowodować wzrost ciśnienia wewnątrz butelki.', 'https://static.openfoodfacts.org/images/products/590/050/003/8594/front_pl.4.400.jpg', '', '', '10.5', '10.5', '', '', '', '', '', '1');

