VALUES ('5900749610421', 'Owsianka z 5 owocami leśnymi', 'Płatki _owsiane_ 61%; cukier, _mleko_ w proszku odtłuszczone, płatki orkiszowe 2,1%; płatki _żytnie_ 2,1%; aromaty, czarny bez liofilizowany 1,1%; malina liofilizowana 1%; żurawina kandyzowana 0,9% (żurawina 60%, cukier, olej słonecznikowy); czarna porzeczka liofilizowana 0,7%; jagoda liofilizowana 0,5%; sok z czerwonego buraka, sól, regulator kwasowości: kwas cytrynowy. Produkt może zawierać jaja i soję.', 'https://static.openfoodfacts.org/images/products/590/074/961/0421/front_pl.4.400.jpg', '4.4', '0.8', '65', '24', '7.6', '13', '0.37', '0.145669291338583', '', '1');

