VALUES ('5900749610933', 'Ba! 5 Bakalii', 'Składniki: Składniki zbożowe 24% (płatki _owsiane_ pełnoziarniste 10%, mąka kukurydziana, mąka ryżowa); substancja wiążąca: maltitole, polewa o smaku kakaowo-mlecznym 15% [olej palmowy, serwatka w proszku (z _mleka_), cukier, kakao w proszku o obniżonej zawartości tłuszczu 6%, _mleko_ w proszku odtłuszczone, miazga kakaowa 1%, emulgatory: lecytyny i E 476, aromaty], jabłka liofilizowane 9,5%, rodzynki 5,6% (rodzynki 99.5%, olej bawełniany i/lub słonecznikowy), żurawina suszona cięta 5,6% (żurawina 51%, cukier, olej słonecznikowy), śliwki suszone cięte 4,5% (śliwki suszone, substancja konserwująca: sorbinian potasu), morele suszone cięte 4,5 % (morele suszone, substancja konserwująca, _dwutlenek siarki_); maltodekstryna, miód piekarski, olej palmowy, substancja utrzymująca wilgoć: sorbitole; regulator kwasowości: kwas cytrynowy, aromat, emulgator: lecytyny; sól, cynamon. Może zawierać _orzeszki ziemne_, inne _orzechy_, _soję_ oraz _sezam_. Spożycie w nadmiernych ilościach może mieć efekt przeczyszczający.', 'https://static.openfoodfacts.org/images/products/590/074/961/0933/front_pl.4.400.jpg', '6.8', '5.3', '76', '25', '4.5', '4', '0.15', '0.0590551181102362', '', '1');

