VALUES ('5900749624954', 'Ba! 5 owoców leśnych', 'Składniki zbożowe 36% ( płatki _owsiane_ pełnoziarniste 24%, maka kukurydziana, maka ryżowa); substancja wiążąca: maltitole; żurawina suszona cięta 18% (żurawina 51%, cukier, olej słonecznikowy); polewa o smaku jogurtowym 15% [olej palmowy, serwatka w proszku (z _mleka_), cukier, _mleko_ w proszku odtłuszczone, proszek jogurtowy 2% (jogurt w proszku (z _mleka_) 80%, _mleko_ w proszku odtłuszczone), tłuszcz kakaowy, emulgator: lecytyny; aromaty]; maltodekstryna, miód piekarski, olej palmowy, malina liofilizowana kawałki 0,3%, jeżyna liofilizowana kawałki 0,3%, jagoda liofilizowana kawałki 0,3%, borówka liofilizowana kawałki 0,3 %, substancja utrzymująca wilgoć: sorbitole; regulator kwasowości: kwas cytrynowy; sól, emulgator: lecytyny; aromat. Produkt może zawierać _orzeszki ziemne_, inne _orzechy_, _soję_ oraz _sezam_. Spożycie w nadmiernych ilościach może mieć efekt przeczyszczający.', 'https://static.openfoodfacts.org/images/products/590/074/962/4954/front_pl.19.400.jpg', '9.5', '6.6', '74', '22', '4.1', '4.7', '0.11', '0.0433070866141732', '', '1');

