VALUES ('5900783004057', 'Fasolka po bretońsku z kiełbasą i boczkuem w sosie pomidorowym', 'Woda, fasola biała 34%, kiełbasa 11% (mięso wieprzowe 68%, woda, skrobia ziemniaczana, sól, błonnik _pszenny_, przyprawy, izolat białka _soi_, substancja zageszczająca: E407, stabilizator: E450, glukoza, przeciwutleniacz: E301, substancja konserwująca E250), boczek wędzony 3,5% (boczek wieprzowy 85%, woda, sól, glukoza, przeciwutleniacz: E316, stabilizator: E450, regulator kwasowości: E331, substancja zagęszczająca: E407, substancja konserwująca E250), koncentrat pomidorowy 3,5%, skrobia kukurydziana modyfikowana, cukier, cebula, mąka _pszenna_, sól, czosnek świeży, mieszanka przyprawowo-smakowa [sól, cukier, marchew, ekstrakt drożdżowy, cebula, zioła, barwnik (ryboflawiny)], musztarda (woda, _gorczyca_, ocet, cukier, sól, przyprawy), aromaty, aromat dymu wędzarniczego (zawiera _mleko_), przyprawy.', 'https://static.openfoodfacts.org/images/products/590/078/300/4057/front_pl.4.400.jpg', '7.4', '0.7', '10', '2.7', '1.4', '3.6', '0.9', '0.354330708661417', '', '1');

